class Team extends React.Component{

    render() {
        const data = this.props.teamData;
        console.log(this.props.teamData);

        return(
            <div id= 'recruiting-team'>
                {/* <Container> */}
                    {this.props.teamData.map(profile => <RecruiterCard /*key={profile.id}*/ {...profile}/>)}
                {/* </Container> */}

            </div>
        );
    }

}

export default Team;
